,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'FUNCTION render_dynamic_action(p_dynamic_action IN apex_plugin.t_dynamic_action,',
'                               p_plugin         IN apex_plugin.t_plugin)',
'  RETURN apex_plugin.t_dynamic_action_render_result IS',
'  --',
'  -- plugin attributes',
'  l_result  apex_plugin.t_dynamic_action_render_result;',
'  l_pdf_source            p_dynamic_action.attribute_01%TYPE := p_dynamic_action.attribute_01;',
'  l_pdf_source_text       p_dynamic_action.attribute_02%TYPE := p_dynamic_action.attribute_02;',
'  l_form_data_source      p_dynamic_action.attribute_03%TYPE := p_dynamic_action.attribute_03;',
'  l_form_data_source_item p_dynamic_action.attribute_04%TYPE := p_dynamic_action.attribute_04;',
'  l_form_data_source_text p_dynamic_action.attribute_05%TYPE := p_dynamic_action.attribute_05;',
'  l_pdf_target            p_dynamic_action.attribute_06%TYPE := p_dynamic_action.attribute_06;',
'  l_file_name             p_dynamic_action.attribute_07%TYPE := p_dynamic_action.attribute_07;',
'  l_list_fields_only      p_dynamic_action.attribute_08%TYPE := p_dynamic_action.attribute_08;',
'  l_list_in_region        p_dynamic_action.attribute_09%TYPE := p_dynamic_action.attribute_09;',
'  --',
'BEGIN',
'  -- Debug',
'  IF apex_application.g_debug THEN',
'    apex_plugin_util.debug_dynamic_action(p_plugin         => p_plugin,',
'                                          p_dynamic_action => p_dynamic_action);',
'  END IF;',
'',
'  l_result.javascript_function := ''PDFFormFiller.fillPDF'';',
'  l_result.ajax_identifier     := apex_plugin.get_ajax_identifier;',
'  l_result.attribute_01        := l_pdf_source;',
'  l_result.attribute_02        := l_pdf_source_text;',
'  l_result.attribute_03        := l_form_data_source;',
'  l_result.attribute_04        := l_form_data_source_item;',
'  l_result.attribute_05        := l_form_data_source_text;',
'  l_result.attribute_06        := l_pdf_target;',
'  l_result.attribute_07        := l_file_name;',
'  l_result.attribute_08        := l_list_fields_only;',
'  l_result.attribute_09        := l_list_in_region;',
'  --',
'  RETURN l_result;',
'  --',
'END render_dynamic_action;',
'',
'FUNCTION ajax_dynamic_action(p_dynamic_action IN apex_plugin.t_dynamic_action,',
'                             p_plugin         IN apex_plugin.t_plugin)',
'  RETURN apex_plugin.t_dynamic_action_ajax_result IS',
'  l_result apex_plugin.t_dynamic_action_ajax_result;',
'',
'  l_action                VARCHAR2(255) := apex_application.g_x01;',
'  l_pdf_source_text       p_dynamic_action.attribute_02%TYPE := p_dynamic_action.attribute_02;',
'  l_form_data_source      p_dynamic_action.attribute_03%TYPE := p_dynamic_action.attribute_03;',
'  l_form_data_source_text p_dynamic_action.attribute_05%TYPE := p_dynamic_action.attribute_05;',
'',
'  l_plsql_code VARCHAR2(32767) := q''[',
'    DECLARE',
'      l_rv VARCHAR2(32767) := ''{}'';',
'    BEGIN',
'      EXECUTE IMMEDIATE q''~#ADDSQLHERE#~'' INTO l_rv;',
'      HTP.PRN(l_rv);',
'    EXCEPTION',
'      WHEN no_data_found THEN ',
'        HTP.PRN(l_rv);',
'    END;',
'  ]'';',
'',
'  l_plsql_code_b VARCHAR2(32767) := q''[',
'    DECLARE',
'      l_lob    BLOB;',
'      l_b64    CLOB;',
'',
'      l_amount INTEGER := 4000;',
'      l_offset INTEGER := 1;',
'      l_buffer VARCHAR2(4000);      ',
'    BEGIN',
'      EXECUTE IMMEDIATE q''~#ADDSQLHERE#~'' INTO l_lob;',
'      ',
'      l_b64 := APEX_WEB_SERVICE.BLOB2CLOBBASE64(l_lob);',
'      LOOP',
'        DBMS_LOB.read(l_b64, l_amount, l_offset, l_buffer);',
'        l_offset := l_offset + l_amount;',
'        HTP.p(l_buffer); ',
'      END LOOP;',
'    EXCEPTION',
'      WHEN others THEN ',
'        null;',
'    END;',
'  ]'';',
'  ',
'BEGIN',
'  IF l_action=''getformdata'' AND l_form_data_source=''SQL'' THEN',
'    l_plsql_code := REPLACE(l_plsql_code,''#ADDSQLHERE#'',l_form_data_source_text);',
'    APEX_PLUGIN_UTIL.execute_plsql_code (',
'        p_plsql_code => l_plsql_code );',
'  END IF;',
'',
'  IF l_action=''getfile'' THEN',
'    l_plsql_code_b := REPLACE(l_plsql_code_b,''#ADDSQLHERE#'',l_pdf_source_text);',
'    APEX_PLUGIN_UTIL.execute_plsql_code (',
'        p_plsql_code => l_plsql_code_B );',
'  END IF;',
'  RETURN l_result;',
'END ajax_dynamic_action;',
'',
''))
